QUnit.extend(QUnit,{close:function(actual,expected,maxDifference,message){var passes=actual===expected||Math.abs(actual-expected)<=maxDifference;QUnit.push(passes,actual,expected,message)},notClose:function(actual,expected,minDifference,message){QUnit.push(Math.abs(actual-expected)>minDifference,actual,expected,message)}});
